package javaassignment;

public class NumberPattern6 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int count=0;
		for(int i=1;i<=5;i++)
			
		{
			for(int j=1;j<=3;j++)
			{
				
				count=count+1;
				
				System.out.print(count+"");
			}
			System.out.println();
		}
		
		
  
	}

}
